import { StyleSheet } from "react-native";

export const estilos = StyleSheet.create({
    botao: {
        position: 'absolute',
        bottom: 20,
        right: 20,
        height: 50,
        backgroundColor: '#303030',
        borderRadius: 20,
        paddingHorizontal: 15,
        paddingBottom: 6,
        alignItems: 'center',
        justifyContent: 'center',
        borderWidth: 2,
        borderColor: '#F4C095',
    },
    textoBotao: {
        fontSize: 24,
        color: '#F4C095',
        fontWeight: '500',
    },
})
